import React from 'react';

const Conditions = (props) => {
    return (
        <div>
        {props.responseObj.main.temp >= 80 ? 
            <div className="warm">
                <p>It's warm outside. Loading recommendations for outdoor spots...</p>
            </div>
        :
            <p>It's cold outside. Loading recommendations for indoor spots...</p>}
        </div>
    )
}

export default Conditions;
